import * as React from 'react';
import Dashboard from './Components/Dashboard';
import Community from './Components/Community';
import Votes from './Components/Votes';
import Pagestate from './Components/Pagestate';
import Package from './Components/Packge';
import Reservation from './Components/Reservation';
import User from './Components/User';
import './assets/styles/custom.css';
import {
    BrowserRouter, Link,
    Route, Router,
    Routes
} from "react-router-dom";
import Login from "./Components/Login";
import LoginPage from "./Components/LoginPage";

export default function App() {

    const handleLogout = () => {
        localStorage.clear();
        window.location.href = '/'
    }

    return (

        <div className='container'>
            <h1>TuComunidad </h1>  <b>Login By : {localStorage.getItem("name")} </b>
            {localStorage.getItem("id") ?
            <div className='row header'>
                <nav>
                    <Link to="/dashboard">Home |</Link>
                    <Link to="/#">Page of state |</Link>
                    <Link to="/reservation">Reservation |</Link>
                    <Link to="/forum">Forum |</Link>
                    <Link to="/votes">Votes |</Link>
                    <Link to="/package">Packages |</Link>
                    <Link to="/#">User |</Link>
                    <input type="button" onClick={handleLogout} value="Logout" />
                </nav>
            </div> :   <div className='row header'> </div> }
            <div className='content'>

                <Routes>
                    <Route path="/"   element={<Login/>} />
                    <Route path="/dashboard" element={<Dashboard/>} />
                    <Route path="/pagestate" element={<Pagestate />} />
                    <Route path="/reservation" element={<Reservation />} />
                    <Route path="/forum" element={<Community />} />
                    <Route path="/votes" element={<Votes />} />
                    <Route path="/package" element={<Package />} />
                    <Route path="/user" element={<User />} />
                </Routes>
            </div>
        </div>

    );
}
